import styled from "styled-components";

const HeaderContainer = styled.div`
  background: #142610;
  height: 20 rem;

  h1 {
    text-align: center;
    color: #fafaee;
    margin: 0px;
    padding: 9rem;
    font-family: "NotoSerifBold";
    font-size: 4rem;
  }

  svg {
    width: 24px;
    height: 24px;
    /* Add additional styles to center the SVG */
    margin-left: auto;
    margin-right: auto;
  }
`;

const Header = () => {
  return (
    <HeaderContainer>
      <svg viewBox="0 0 100 100"></svg>
      <h1>My favorite veggies</h1>
    </HeaderContainer>
  );
};

export default Header;
